 "{\"data\":[{\"caption\":\"YHKFd\",\"message\":\"UHH7O\",\"created_time\":\"2015-01-15T11:42:12+0000\",\"type\":\"link\",\"description\":\"The performance of Storage API was decreased between 11:30 - 12:30 CET. It affected also response time of  Keboola Connection user interface.\\n\\nThe issue is resolved now.\",\"id\":\"177057932317550_859677620722241\"},{\"caption\":\"JrbTG\",\"message\":\"72gQ6\",\"created_time\":\"2015-01-14T17:19:14+0000\",\"type\":\"link\",\"description\":\"Test connection for given database credentials before saving them.\\nProvide SSL certificates to establish more secure connection(MySQL only). \",\"id\":\"177057932317550_859192114104125\"},{\"caption\":\"hxJv4\",\"message\":\"CG33h\",\"created_time\":\"2015-01-08T22:12:56+0000\",\"type\":\"link\",\"description\":\"We have slightly changed the layout of the transformation detail (sections moved to tabs) and added an Overview graph. \\n\\n \\n\\n   \\n\\n \\n\\n  \\n\\n \\n\\n\\nThe graph shows the data flow around the current...\",\"id\":\"177057932317550_856461684377168\",\"likes\":{\"data\":[{\"name\":\"Z7G7r\",\"id\":\"10101284294684967\"},{\"name\":\"x68CD\",\"id\":\"10208033655990803\"}],\"paging\":{\"cursors\":{\"before\":\"MTAxMDEyODQyOTQ2ODQ5NjcZD\",\"after\":\"MTAyMDgwMzM2NTU5OTA4MDMZD\"}}},\"comments\":{\"data\":[{\"message\":\"5f5rJ\",\"created_time\":\"2015-01-08T22:26:55+0000\",\"from\":{\"name\":\"LCoYz\",\"id\":\"10208033655990803\"},\"id\":\"856461684377168_856466061043397\"}],\"paging\":{\"cursors\":{\"before\":\"WTI5dGJXVnVkRjlqZAFhKemIzSTZAPRFUyTkRZAMk1EWXhNRFF6TXprM09qRTBNakEzTlRZAd01UWT0ZD\",\"after\":\"WTI5dGJXVnVkRjlqZAFhKemIzSTZAPRFUyTkRZAMk1EWXhNRFF6TXprM09qRTBNakEzTlRZAd01UWT0ZD\"}}}},{\"caption\":\"Qd21f\",\"message\":\"C0wFK\",\"created_time\":\"2015-01-07T22:49:59+0000\",\"type\":\"link\",\"description\":\"On January 17th, 2015 we will perform scheduled upgrade of our meta-data servers. This will cause a maintenance window from 2:00 pm to 3:00 pm (GMT+1), or 5:00am to 6:00am (PST).\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nDuring...\",\"id\":\"177057932317550_856006187756051\"},{\"caption\":\"gsMRg\",\"message\":\"bgPez\",\"created_time\":\"2015-01-06T20:43:33+0000\",\"type\":\"link\",\"description\":\"There's a direct link to GoodData LDM Visualizer in the model page in GoodData Writer. So in a single click you can compare what is defined in Keboola Connection and what has been already uploaded...\",\"id\":\"177057932317550_854822971207706\",\"likes\":{\"data\":[{\"name\":\"5eElt\",\"id\":\"10209388523741267\"},{\"name\":\"86xY5\",\"id\":\"10210976430994425\"}],\"paging\":{\"cursors\":{\"before\":\"MTAyMDkzODg1MjM3NDEyNjcZD\",\"after\":\"MTAyMTA5NzY0MzA5OTQ0MjUZD\"}}}},{\"caption\":\"K204a\",\"message\":\"DZnq9\",\"created_time\":\"2014-12-22T19:22:12+0000\",\"type\":\"link\",\"description\":\"We're now showing bucket and transformation descriptions in the UI. Currently there's no way to change the bucket description - it is defined setup when the bucket is created, but we're working on...\",\"id\":\"177057932317550_843461772343826\"},{\"caption\":\"QicNa\",\"message\":\"HWT9Y\",\"created_time\":\"2014-12-22T06:01:43+0000\",\"type\":\"link\",\"description\":\"Due to a possible significant inconsistency in real and estimated number of rows (and table sizes) on the MySQL Storage backend which could lead to data loss when editing the data sample, we turned...\",\"id\":\"177057932317550_843202225703114\"},{\"caption\":\"FuUKJ\",\"message\":\"w13uK\",\"created_time\":\"2014-12-20T00:19:08+0000\",\"type\":\"link\",\"description\":\"We have released a new version of Transformation API. See the changelog here. In a case of a major issue, we'll roll back to the previous version.\\n\\nIf you encouter any problems, please contact us...\",\"id\":\"177057932317550_842012709155399\"},{\"caption\":\"M0xDV\",\"message\":\"cBNDK\",\"created_time\":\"2014-12-19T15:06:55+0000\",\"type\":\"link\",\"description\":\"Several projects may have experienced errors in extractor jobs processing. Database, Zendesk, Google drive and some other extractors were affected. Issue is resolved now and we are investigation...\",\"id\":\"177057932317550_841844912505512\"},{\"caption\":\"c6x1D\",\"message\":\"Xr40B\",\"created_time\":\"2014-12-17T10:58:40+0000\",\"type\":\"link\",\"description\":\"Configure database extractor to extract data from PostgreSQL database.\",\"id\":\"177057932317550_840894219267248\"},{\"caption\":\"yO4X3\",\"message\":\"H1opX\",\"created_time\":\"2014-12-15T17:35:00+0000\",\"type\":\"link\",\"description\":\"We'll be releasing updated version of the Transformation API (and accordingly modified UI) later this week. Changes will include:\\n\\n All transformation and sandbox job are asynchronous. \\nMore...\",\"id\":\"177057932317550_840209139335756\"},{\"caption\":\"6JzaV\",\"message\":\"6Lu5J\",\"created_time\":\"2014-12-09T19:45:26+0000\",\"type\":\"link\",\"description\":\"As a part of the ongoing Transformation API overhaul we've changed transformation events. We tried to keep it simple, so there's one event for each:\\n\\nEngine startup Start of a phase Database...\",\"id\":\"177057932317550_836616029695067\"},{\"caption\":\"R0SZb\",\"message\":\"8sVUl\",\"created_time\":\"2014-12-08T09:08:44+0000\",\"type\":\"link\",\"description\":\"We've just developed a new extractor, which allows you to export data from various APIs, by just setting their URL and a few other parameters in configuration bucket.\\n\\nWhat it can do:\\n\\nExport data...\",\"id\":\"177057932317550_835895269767143\",\"likes\":{\"data\":[{\"name\":\"RESHj\",\"id\":\"10101284294684967\"}],\"paging\":{\"cursors\":{\"before\":\"MTAxMDEyODQyOTQ2ODQ5NjcZD\",\"after\":\"MTAxMDEyODQyOTQ2ODQ5NjcZD\"}}}},{\"caption\":\"lLrCu\",\"message\":\"cXbah\",\"created_time\":\"2014-12-02T15:41:46+0000\",\"type\":\"link\",\"description\":\"We developed a new version of the SalesForce.com extractor and renamed the current version to SalesForce.com (Deprecated).\\n\\n \\n\\n   \\n\\n \\n\\n  \\n\\n \\n\\n\\nAs some of the changes introduced in the new version...\",\"id\":\"177057932317550_832653096758027\",\"likes\":{\"data\":[{\"name\":\"7Lbn6\",\"id\":\"10208033655990803\"},{\"name\":\"vnuTR\",\"id\":\"10101284294684967\"}],\"paging\":{\"cursors\":{\"before\":\"MTAyMDgwMzM2NTU5OTA4MDMZD\",\"after\":\"MTAxMDEyODQyOTQ2ODQ5NjcZD\"}}}},{\"caption\":\"BKOqV\",\"message\":\"Zhdvv\",\"created_time\":\"2014-12-01T13:35:41+0000\",\"type\":\"link\",\"description\":\"Attach your data(a csv or gzipped csv file) and send it to a given email, the pigeon will check the inbox and import the received attachment into a storage api table. The whole work flow can be...\",\"id\":\"177057932317550_831635373526466\",\"likes\":{\"data\":[{\"name\":\"UohU4\",\"id\":\"10212183000078252\"}],\"paging\":{\"cursors\":{\"before\":\"MTAyMTIxODMwMDAwNzgyNTIZD\",\"after\":\"MTAyMTIxODMwMDAwNzgyNTIZD\"}}}},{\"caption\":\"6n069\",\"message\":\"fHmX5\",\"created_time\":\"2014-12-01T08:33:03+0000\",\"type\":\"link\",\"description\":\"We have added a new App Annie (http://www.appannie.com/) extractor to our connectors portfolio. \\n\\nIt is available in the Add Extractor menu in your project. The user interface is underway, but feel...\",\"id\":\"177057932317550_831492690207401\"},{\"caption\":\"C5jCb\",\"message\":\"RYuF1\",\"created_time\":\"2014-11-28T18:17:24+0000\",\"type\":\"link\",\"description\":\"We've deployed a new version of Facebook Extractor, you can now see all extractor's jobs in the Jobs app. If you encounter any problems, please let us know at support@keboola.com.\",\"id\":\"177057932317550_829756233714380\",\"likes\":{\"data\":[{\"name\":\"5iGl0\",\"id\":\"10212298448843320\"}],\"paging\":{\"cursors\":{\"before\":\"MTAyMTIyOTg0NDg4NDMzMjAZD\",\"after\":\"MTAyMTIyOTg0NDg4NDMzMjAZD\"}}}},{\"caption\":\"7U2jX\",\"message\":\"T0LBP\",\"created_time\":\"2014-11-26T23:48:41+0000\",\"type\":\"link\",\"description\":\"We just introduced an icon in input mapping to show, whether the input mapping is created as a view or a table. \\n\\n \\n\\n   \\n\\n \\n\\n  \\n\\n \\n\\n\\nRunning Redshift transformations and reading data from Redshift...\",\"id\":\"177057932317550_828735377149799\",\"likes\":{\"data\":[{\"name\":\"R2NsO\",\"id\":\"10101284294684967\"}],\"paging\":{\"cursors\":{\"before\":\"MTAxMDEyODQyOTQ2ODQ5NjcZD\",\"after\":\"MTAxMDEyODQyOTQ2ODQ5NjcZD\"}}}},{\"caption\":\"Jx8pT\",\"message\":\"uWz71\",\"created_time\":\"2014-11-20T11:32:28+0000\",\"type\":\"link\",\"description\":\"UI for zendesk extractor has been visually redesigned.\",\"id\":\"177057932317550_824196854270318\"},{\"caption\":\"m3cBM\",\"message\":\"yYTvs\",\"created_time\":\"2014-11-15T22:06:52+0000\",\"type\":\"link\",\"description\":\"Orchestrator's email notifications were redesigned. \\n\\nIf anything wrong happen, Orchestrator send you brief visual overview. All necessary details are accessible through UI. We're not spamming you...\",\"id\":\"177057932317550_822018727821464\",\"likes\":{\"data\":[{\"name\":\"dvNZa\",\"id\":\"401232140086543\"}],\"paging\":{\"cursors\":{\"before\":\"NDAxMjMyMTQwMDg2NTQz\",\"after\":\"NDAxMjMyMTQwMDg2NTQz\"}}}},{\"caption\":\"JpLqJ\",\"message\":\"NSnQB\",\"created_time\":\"2014-11-06T09:15:08+0000\",\"type\":\"link\",\"description\":\"Paymo, Facebook, Facebook Ads and Salesforce extractors were returning curl(60) error in orchestrations from 3 PM - 11PM PST November 6th. Error was caused by invalid SSL certificates.\\n\\nTo finish...\",\"id\":\"177057932317550_815860998437237\"},{\"caption\":\"GcTlt\",\"message\":\"J22Et\",\"created_time\":\"2014-11-05T09:29:28+0000\",\"type\":\"link\",\"description\":\"Some files were not accessible between 7 PM - 10 PM November 4. It caused failures of loads to storage API tables and thus also orchestration failures.\\n\\nExample of failed orchestration:\\n\\n \\n\\n   \\n\\n...\",\"id\":\"177057932317550_815328998490437\"},{\"caption\":\"441Gh\",\"mes