 "{\"data\":[{\"caption\":\"grfLN\",\"message\":\"fgo6F\",\"created_time\":\"2015-03-26T09:38:34+0000\",\"type\":\"link\",\"description\":\"Some orchestrations have failed around 09:46 AM CET, it was caused by SSL issues in Storage API.\\n\\nProblem is fixed now, failed orchestrations are restarted. Sorry for inconvenience.\",\"id\":\"177057932317550_894908463865823\"},{\"caption\":\"9d72s\",\"message\":\"Epuqy\",\"created_time\":\"2015-03-25T18:39:57+0000\",\"type\":\"link\",\"description\":\"We changed the naming conventions for MySQL provisioning. Instead of tapi_3800_sand and tapi_3800_tran, where 3800 is my token ID, the new database names are sand_232_3800 and tran_3800, where 232...\",\"id\":\"177057932317550_894591280564208\"},{\"message\":\"HpqVc\",\"created_time\":\"2015-03-19T02:27:18+0000\",\"type\":\"photo\",\"id\":\"177057932317550_890214517668551\",\"likes\":{\"data\":[{\"name\":\"xe4mv\",\"id\":\"10204880342142922\"},{\"name\":\"2qp99\",\"id\":\"10153427691999994\"},{\"name\":\"hGOfm\",\"id\":\"10203960429963206\"},{\"name\":\"i3yrb\",\"id\":\"10205597690814213\"},{\"name\":\"BLY56\",\"id\":\"10206275375873491\"},{\"name\":\"6hux0\",\"id\":\"10205129013279704\"},{\"name\":\"FqOJx\",\"username\":\"KeboolaHQ\",\"id\":\"177057932317550\"},{\"name\":\"d3aCs\",\"id\":\"685459198231260\"},{\"name\":\"n7QDq\",\"id\":\"1072622009419947\"},{\"name\":\"ofPpw\",\"id\":\"10101284294684967\"}],\"paging\":{\"cursors\":{\"before\":\"MTAyMDQ4ODAzNDIxNDI5MjIZD\",\"after\":\"MTAxMDEyODQyOTQ2ODQ5NjcZD\"}}}},{\"caption\":\"TTo5h\",\"message\":\"WSTo3\",\"created_time\":\"2015-03-05T14:15:36+0000\",\"type\":\"link\",\"description\":\"Mailgun.com, backend API powering our Pigeon Extractor (email data import), has an incidents with their infrastructure (caused by Rackspace maintenance). Their status page is here, twitter account...\",\"id\":\"177057932317550_882565748433428\"},{\"caption\":\"vNYfe\",\"message\":\"869kV\",\"created_time\":\"2015-02-27T18:53:14+0000\",\"type\":\"link\",\"description\":\"For all columns without a defined datatype in a Redshift transformation we added a default LZO compression. This will lead to a marginally slower transformation times but significantly less memory...\",\"id\":\"177057932317550_880197812003555\"},{\"caption\":\"JQUdj\",\"message\":\"PmNVc\",\"created_time\":\"2015-02-24T16:55:24+0000\",\"type\":\"link\",\"description\":\"A few weeks ago, we silently launched ability to create Storage API Aliases by using your own SQL code. These Alias Tables with custom SQL can be created with Redshift backend only. Create New...\",\"id\":\"177057932317550_878834132139923\",\"likes\":{\"data\":[{\"name\":\"tTH2r\",\"username\":\"KeboolaHQ\",\"id\":\"177057932317550\"},{\"name\":\"oqecI\",\"id\":\"10205490289401524\"}],\"paging\":{\"cursors\":{\"before\":\"MTc3MDU3OTMyMzE3NTUw\",\"after\":\"MTAyMDU0OTAyODk0MDE1MjQZD\"}}}},{\"caption\":\"HKQPE\",\"message\":\"mnEHv\",\"created_time\":\"2015-02-24T10:49:45+0000\",\"type\":\"link\",\"description\":\"Tables can be  aliased between out and in stage in both ways from now. It is no longer limited to only in -> out direction.\",\"id\":\"177057932317550_878717075484962\"},{\"caption\":\"H1sRL\",\"message\":\"fOr0R\",\"created_time\":\"2015-02-20T19:01:57+0000\",\"type\":\"link\",\"description\":\"Wait... what is R?\\n\\nWe've developed the backend and UI for transformations in R. All R transformations run in our public Docker image and have 1 GB memory allowance (will increase in near...\",\"id\":\"177057932317550_876759985680671\",\"likes\":{\"data\":[{\"name\":\"G4zGs\",\"id\":\"10158109802090627\"},{\"name\":\"33up4\",\"id\":\"10208033655990803\"},{\"name\":\"ZfFnM\",\"username\":\"KeboolaHQ\",\"id\":\"177057932317550\"}],\"paging\":{\"cursors\":{\"before\":\"MTAxNTgxMDk4MDIwOTA2MjcZD\",\"after\":\"MTc3MDU3OTMyMzE3NTUw\"}}}},{\"caption\":\"ZCS3w\",\"message\":\"8OrRs\",\"created_time\":\"2015-02-19T22:57:01+0000\",\"type\":\"link\",\"description\":\"There has been a bug in both AdWords and Sklik extractors which caused undelivery of data to input tables since Feb 17 13:00 UTC. Actually the data had been saved to wrong bucket: in.c-ex-adwords...\",\"id\":\"177057932317550_876391385717531\"},{\"caption\":\"rW8v4\",\"message\":\"Rivhe\",\"created_time\":\"2015-02-19T21:42:46+0000\",\"type\":\"link\",\"description\":\"AWS recently issued some information about connectivity issue in US-EAST-1 Region, where majority of our infrastructure is located. This may result in 500, 503 and 504 application errors within the...\",\"id\":\"177057932317550_876365615720108\"},{\"caption\":\"afmwO\",\"message\":\"5Vp5x\",\"created_time\":\"2015-02-11T12:46:47+0000\",\"type\":\"link\",\"description\":\"Storage Api Console now proceeds all tables exports ansychronously. Synchronous table export is deprecated.\",\"id\":\"177057932317550_871770149512988\"},{\"caption\":\"MUkBz\",\"message\":\"vtuS5\",\"created_time\":\"2015-02-10T23:04:55+0000\",\"type\":\"link\",\"description\":\"From now on you can use all OUT tables in all transformations. Previous restrictions on using OUT tables in Redshift transformations were removed.\",\"id\":\"177057932317550_871542359535767\"},{\"caption\":\"a1M04\",\"message\":\"30MNy\",\"created_time\":\"2015-02-10T09:06:05+0000\",\"type\":\"link\",\"description\":\"There is lot of sheduled jobs waiting in orchestrations queue, we are adding more workers to resolve this issue.\",\"id\":\"177057932317550_871299946226675\"},{\"caption\":\"cqu6G\",\"message\":\"qDnHw\",\"created_time\":\"2015-02-04T08:47:55+0000\",\"type\":\"link\",\"description\":\"There was a bug in import to Storage API from transformations, it was present only in the following conditions:\\n\\nRedshift transformation with output to Redshift table Output was incremental...\",\"id\":\"177057932317550_868726169817386\"},{\"caption\":\"JmLIe\",\"message\":\"gTQ5B\",\"created_time\":\"2015-02-04T08:19:07+0000\",\"type\":\"link\",\"description\":\"Storage now supports snapshotting and creating tables from snapshots for Redshift backend. Snapshots are compatible between backends, so you can use snapshotting feature for migration of tables...\",\"id\":\"177057932317550_868721253151211\"},{\"caption\":\"NepZL\",\"message\":\"qBOHx\",\"created_time\":\"2015-02-03T01:03:20+0000\",\"type\":\"link\",\"description\":\"We had some issues in one of our components (job handling queue) between 10pm and 10:15pm PST on Sunday night (03:00–03:15 UTC Monday). That had resulted in some failed orchestrations (scheduled at...\",\"id\":\"177057932317550_868201209869882\"},{\"caption\":\"8ob0f\",\"message\":\"EjHbK\",\"created_time\":\"2015-02-02T17:30:06+0000\",\"type\":\"link\",\"id\":\"177057932317550_868084153214921\",\"likes\":{\"data\":[{\"name\":\"0FOWG\",\"username\":\"KeboolaHQ\",\"id\":\"177057932317550\"}],\"paging\":{\"cursors\":{\"before\":\"MTc3MDU3OTMyMzE3NTUw\",\"after\":\"MTc3MDU3OTMyMzE3NTUw\"}}}},{\"caption\":\"4fJhe\",\"message\":\"N3tF2\",\"created_time\":\"2015-02-02T08:52:14+0000\",\"type\":\"link\",\"description\":\"As previously announced old Twitter extractor was shut down today.\",\"id\":\"177057932317550_867918849898118\"},{\"caption\":\"MKPWH\",\"message\":\"Z5oka\",\"created_time\":\"2015-02-01T22:50:49+0000\",\"type\":\"link\",\"description\":\"We're announcing public Trello board, where you can lobby for Keboola Connection features - it's your wishlist.\\n\\n \\n\\n   \\n\\n \\n\\n  \\n\\n \\n\\n\\nYou can add your ideas by emailing it to wishlist@keboola.com and...\",\"id\":\"177057932317550_867662119923791\",\"likes\":{\"data\":[{\"name\":\"9JKaT\",\"id\":\"994150993986261\"},{\"name\":\"vpUoB\",\"id\":\"10157194015270291\"}],\"paging\":{\"cursors\":{\"before\":\"OTk0MTUwOTkzOTg2MjYx\",\"after\":\"MTAxNTcxOTQwMTUyNzAyOTEZD\"}}}},{\"caption\":\"xuWs3\",\"message\":\"Vb7ah\",\"created_time\":\"2015-01-22T16:06:00+0000\",\"type\":\"link\",\"description\":\"Parameter tableId of data loading API calls /gooddata-writer/load-data and /gooddata-writer/load-data-multi are now optional. If the parameter is not present, data load will be performed to all...\",\"id\":\"177057932317550_863179447038725\"},{\"caption\":\"rz7R3\",\"message\":\"aCQKo\",\"created_time\":\"2015-01-20T16:26:14+0000\",\"type\":\"link\",\"description\":\"Google Drive and Google Analytics extractors now allow to run extraction of a single sheet/query added to the configuration.\",\"id\":\"177057932317550_862432097113460\"},{\"caption\":\"0cIa3\",\"message\":\"8FYFs\",\"created_time\":\"2015-01-17T21:11:18+0000\",\"type\":\"link\",\"description\":\"After the maintenance window we've started experiencing some technical difficulties with our Elasticsearch cluster resulting in orchestration processing glitches. We're working on it and monitoring...\",\"id\":\"177057932317550_860860447270625\"},{\"caption\":\"kqlm6\",\"message\":\"LFCEC\",\"created_time\":\"2015-01-17T14:05:26+0000\",\"type\":\"link\",\"description\":\"Scheduled maintenance will start 3:45 pm (GMT+1) and will take about 30 minutes.\\n\\nDuring the maintenance, you can't access your data. All network connections will be terminated by \\\"HTTP 503 - down...\",\"id\":\"177057932317550_860597873963549\"},{\"caption\":\"LvBwz\",\"message\":\"EyVy4\",\"created_time\":\"2015-01-16T10:43:32+0000\",\"type\":\"link\",\"description\":\"Run extraction of a single query within a database extractor configuration.\",\"id\":\"177057932317550_860049017351768\",\"likes\":{\"data\":[{\"name\":\"8B9w6\",\"username\":\"KeboolaHQ\",\"id\":\"177057932317550\"}],\"paging\":{\"cursors\":{\"before\":\"MTc3MDU3OTMyMzE3NTUw\",\"after\":\"MTc3MDU3OTMyMzE3NTUw\"}}}},{\"message\":\"Ff742\",\"created_time\":\"2015-01-16T05:53:30+0000\",\"type\":\"status\",\"id\":\"177057932317550_859987434024593\"}],\"paging\":{\"previous\":\"https://graph.facebook.com/v2.8/177057932317550/feed?fields=caption,message,created_time,type,description,likes%7Bname,username%7D,comments%7Bmessage,